"1. Kanca bağlama modunda mı?
Lütfen drone ve kancanın yakınlarda olup olmadığını kontrol edin;
Lütfen drone 'nun açık olup olmadığını kontrol edin;"

"1. Lütfen kancanın drone 'nun yanında olduğundan ve hem drone hem de kancanın açık olduğundan emin olun;
 2. Güç düğmesine kısa basın, ardından 3 saniye uzun basın. Sarı ışık yanıp söndüğünde kanca bağlama moduna girecektir;
3. Otomatik bağlamayı bekleyin. Bir bip sesi duyduğunuzda ve yeşil ışık yanıp söndüğünde, bağlama başarılı olur."
